import React from 'react';
import FeaturedArticles from './home_page/featured/FeaturedArticles';
import ForYou from './home_page/forYou/forYou';
import LatestGrid from './home_page/grid/LatestGrid';
import LatestNews from './home_page/LatestNews/LatestNews';
import './home.css'; // Main CSS file for the entire app
import AdBanner from './FixedComponent';
import '@fortawesome/fontawesome-free/css/all.min.css';


const Home = () => {
  return (
    <div className="apps">

      <div className="app">
      <main className="main-content">
        <div></div>
        <div className='grid'>
        <FeaturedArticles />
        <ForYou />
        <LatestGrid />
        </div>
        <LatestNews />
        <div className='SecAds'>
        <AdBanner className="2nd"/>
        </div>
        <LatestNews />
      </main>
      </div>
    </div>
  );
};

export default Home;
